import Axios from "axios";
function SkillsData() {
  const [userData, setdata] = useState([]);
  const link= 'https://bootcamp-2022.devtest.ge/api/skills';

  function getskill(){
    Axios.get(link).then((response) =>{
      console.log(response);
      setdata({
        id:response.data.id,
        skill: response.data.title
      })
      console.log(userData)
    })

  }
getskill
};
